import React from 'react';
import { NavbarProvider } from './NavbarContext';
import Navbar from './Navbar';

//Navbar
const navlink = {
    Target1: {
        link: "/",
        item: "首頁"
    },
    Target2: {
        link: "/Activity",
        item: "活動"
    },
    Target3: {
        link: "/Product",
        item: "商品"
    }
};

const Header = () => {
    return (
        <>
            <div id="header">
                <NavbarProvider value={navlink}>
                    <Navbar></Navbar>
                </NavbarProvider>
            </div>
        </>
    );
}

export default Header;
